import React from 'react';
import ReactDOM from 'react-dom';

const App = () => {
  return (
    <div>
      <h1>Give Feedback</h1>
      <Button />
      <Button />
      <Button />
      <h1>Statistics</h1>
      <Display />
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById("root"));
